  -> flush all aether / delayed spells\r\r/mobmaster -> switch to on/off (make mobs can detect you)\r\r/ww        -> Walk through the walls/object (on/off)\r\r/bc \"chat\" -> Broadcast\r\r/cspells   -> Clear/delete all spells (self) *must relog\r\r/cinv      -> Clear/delete all inventory (self)\r\r/gmc       -> GM chat channel (on/off)\r\r/res       -> Ressurection (self)\r\r/heal      -> Heal Health = maxHealth (self)\r\r/sum       [string] *target\r\r/app       [string] *target\r\r/gold      [num] *amount\r \r/state     [num] *0 = alive\r                 *1 = dead\r                 *2 = invisible\r                 *3 = mount\r                 *4 = disguise\r\r/speed     [num] *0 = fastest\r\r/s         [num/string] *spell.id / spell.yname\r\r/i         [num/string] *item.id / item.yname\r\r/level     [num] *amount\r\r/hair      [num(, num)] *number of hair,  color\r\r/face      [num(, num)] *number of hair,  color\r\r/silence   [string] *target\r\r/warp      [num(, num(, num))] * map.id, x, y\r\r',7),(22,7,'IDLEEEE',0,0,9,12,'Skill Steed','skill steednya error, sekali di pakai keluar satu. tapi pas di tekan R dia keluar lagi. malah tambah banyak kudanya\rkudanya pun tak bisa di pukul\r',5),(23,8,'Mosessio',0,0,9,15,'Menyelamatkan Chu rua','- Permulaan quest di ambil dari Jade spear setelah mencapai level minimal di atas lv.5 , pilih opsi setuju untuk membantu.\r\r- Kamu akan di pindahkan ke TKP dimana seekor kura2 tolol di hadapanmu sekitar koor (62, 48) klik kura2 tsb.\r\r- Temui Kelinci di sekitar (54, 30). katakan \"Hello\" kemudian katakan \"Ginseng\"\r\r- Temui Batu keramat di (66, 05) <<- ntah ada maksud batu keramat ini. tak ada sangkut paut sebenarnya.. Ikuti aja lah\r\r- Temui macan sok jago di (14, 8) katakanlah \"Rabbit\" atau \"Kelinci\"\r\r- Sebuah Ginseng akan jatuh di pinggir tebing sebelah kiri / barat. Ambil ginseng tsb.\r\r- Temui chu rua kembali dengan membawa ginseng tsb. Dan si kura2 tolol itu telah mendapatkan ginseng nya kembali! Hore\r\r\r\r\rHadiah :\r- Sejumlah EXP\r- 5000 koin\r- 1 Cincin Lautan (Sea Ring)\r- Legenda Menyelamatkan Chu Rua\r\r\r\r\r',1),(24,1,'God',1,0,9,19,'Mythic I opened!','Seluruh tempat hunting yang ada di Mythic I sudah dapat di akses\rtermasuk Mythic I naga.\r',1),(25,1,'God',1,0,9,19,'Quest Updated!','Quest Menyelamatkan Chu rua sudah dapat di ambil.\rSyarat Min level 6. (telah menyelesaikan quest tutor)\rLokasi pengambilan quest di Jadespear buya.',2),(26,1,'God',1,0,9,19,'Monster Update!','Monster Mythic I oleh GM Zapcure dalam proses.\r\rkejar sajah dia biar cepet di selesaikan =P',3),(28,1,'God',1,0,9,24,'Ability','- Sheperd     @Forest (130, 101)\r- Ore Mining  @Forest (211, 32)\r- Gem Mining  @Forest (216, 107)\r- Weaving     @Forest (44, 30)\r- Gem Cutting @Forest (46, 40)\r\r',4),(29,1,'God',1,0,9,26,'Maps updated!','New map \'Artic Land\' & \'Ice cave\' @market\r',5);
